import { useState } from "react";

interface Props {
  onClick?: () => void;
}

const Fasi = ({ onClick }: Props) => {
  const [showList, setShowList] = useState(false);

  function handleButtonClick() {
    setShowList(!showList);
    if (onClick) {
      onClick();
    }
  }
  const fasi = ["6.0", "7.2", "7.4", "7.5"];
  return (
    <>
      <button
        className="w-full py-2 px-4 bg-green-600 text-white rounded-lg hover:bg-green-700 z-0 relative"
        onClick={handleButtonClick}
      >
        Fasi
      </button>
      {showList && (
        <ul>
          {fasi.map((fase, index) => (
            <li key={index}>{fase}</li>
          ))}
        </ul>
      )}
    </>
  );
};

export default Fasi;
